import React, { useState, useEffect } from "react";

const HotelRoomManager = () => {
  // Dữ liệu về các phòng
  const [rooms, setRooms] = useState([]);

  // State để lưu trữ các giá trị của form
  const [checkInDate, setCheckInDate] = useState("");
  const [checkOutDate, setCheckOutDate] = useState("");
  const [roomType, setRoomType] = useState("");
  const token = localStorage.getItem("token");
  // Fetch room data from the API when the component mounts
  useEffect(() => {
    fetch("http://localhost:8080/hotelManagement/rooms", {
      method: "GET",
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
      .then((response) => response.json())
      .then((data) => setRooms(data));
  }, []);

  // Filter rooms based on the selected criteria
  const filteredRooms = rooms.filter((room) => {
    if (roomType === "") return true;
    return room.type === roomType;
  });

  // Handler for adding a new room
  const handleAddRoom = () => {
    // Code to add a new room goes here
    console.log("Add a new room");
  };

  return (
    <div className="hotel-room-manager">
      <div className="filters">
        <div className="date-filters">
          <label htmlFor="check-in">Check-in:</label>
          <input
            type="date"
            id="check-in"
            value={checkInDate}
            onChange={(e) => setCheckInDate(e.target.value)}
          />
          <label htmlFor="check-out">Check-out:</label>
          <input
            type="date"
            id="check-out"
            value={checkOutDate}
            onChange={(e) => setCheckOutDate(e.target.value)}
          />
        </div>
        <div className="room-type-filter">
          <label htmlFor="room-type">Room Type:</label>
          <select
            id="room-type"
            value={roomType}
            onChange={(e) => setRoomType(e.target.value)}
          >
            <option value="">All</option>
            <option value="VIP">VIP</option>
            <option value="TRPL-MV">TRPL-MV</option>
            <option value="TRPL-SV">TRPL-SV</option>
            <option value="TWN-MV">TWN-MV</option>
            <option value="TWN-SV">TWN-SV</option>
          </select>
        </div>
      </div>
      <div className="room-list">
        {filteredRooms.map((room) => (
          <div key={room.id} className={`room-card room-type-${room.type}`}>
            {room.id}
          </div>
        ))}
      </div>
      <div className="add-room">
        <button onClick={handleAddRoom}>Add Room</button>
      </div>
    </div>
  );
};

export default HotelRoomManager;
